Recorrido por las Cataratas del Iguazú – Lado Argentino y Brasileño



Explorá ambos lados del Parque Nacional Iguazú. En Argentina, caminá por las pasarelas que te llevan al corazón de los saltos, incluida la imponente Garganta del Diablo. En Brasil, disfrutá de vistas panorámicas espectaculares y una perspectiva única de la fuerza del agua.



Minas de Piedras Preciosas en Wanda



Descubrí el fascinante mundo de las piedras semipreciosas en las Minas de Wanda. Acompañado por guías expertos, podrás recorrer túneles de basalto y admirar cristales de amatista, ágata y cuarzo en su estado natural.



Ruinas Jesuíticas de San Ignacio



Sumergite en la historia visitando las Ruinas de San Ignacio, declaradas Patrimonio de la Humanidad. Este sitio arqueológico revela el legado de las misiones jesuíticas guaraníes con imponentes estructuras de piedra roja en medio de la selva.



Crucero Iguazú



Viví una experiencia exclusiva a bordo del Crucero Iguazú. Navegá por el río Paraná al atardecer, disfrutando de vistas impresionantes, gastronomía gourmet y un ambiente relajado que combina lujo y naturaleza en su máxima expresión.



